import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useContext } from 'react';
import { AuthContext } from '../contexts/AuthContext';

const NavBar = () => {
    const { signOut } = useContext(AuthContext);
    const navigate = useNavigate();

    const handleSignOut = () => {
        signOut();
        navigate("/");
    };

    return (
        <nav>
            <ul>
                <li><Link to="/sessao/createAdvogado">Create Advogado</Link></li>
                <li><Link to="/sessao/createAssociado">Create Associado</Link></li>
                <li><Link to="/sessao/createCliente">Create Cliente</Link></li>
                <li><Link to="/sessao/listarUsuarios">Listar Usuarios</Link></li>
                <li><button onClick={handleSignOut}>Sign Out</button></li>
            </ul>
        </nav>
    );
}

export default NavBar;
